import React, { useState } from 'react';
import Datepicker from 'react-date-picker';
 
function DatePicker() {
  const [value, onChange] = useState(new Date());
 
  return (
    <div>
      <Datepicker
        onChange={onChange}
        value={value}
      />
    </div>
  );
}

export default DatePicker
